import { Component } from 'react';
import './Pager.css';

class Pager extends Component {
  render() {
    return (
      <ul class="pager">
        <li class="previous">
          <a href="#">Previous</a>
        </li>
        <li class="next">
          <a href="#">Next</a>
        </li>
      </ul>
    );
  }
}

export default Pager;
